import React from "react";

const App=()=>{
    return(
        <>
            <div>
                <h1>Hello</h1>
                <input type="text" placeholder="Enter your name" defaultValue = ""></input>
                <br></br>
                <button>Click me</button>
            </div>
        </>
    )

};

export default App;
